import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheckSquare, faCoffee, faAppleWhole } from '@fortawesome/free-solid-svg-icons';
import Button from 'react-bootstrap/Button';
import Table from 'react-bootstrap/Card';
const Home = () => {

    return (

        <div >
            <Table responsive>
                <thead>
                    <tr>
                    <th>#</th>
                    { books.map((book, index)=>(
                        <th key={index}>{Object.keys(book)}</th>
                    ))}
                    </tr>
                </thead>
                <tbody>
            {
                books.map((book, index)=>(

                    <tr key={index}>
                    <td>{book.id}</td>
                    <td >{book.title}</td>
                    <td>{book.description}</td>
                    <td >{book.publication_date}</td>
                    <td>{book.publisher}</td>
                    <td >{book.ISBN}</td>
                    <td>{book.pages}</td>
                    <td >{book.genre}</td>
                    <td>{book.date_added}</td>
                    </tr>        

                )
            )
            }
             </tbody>
             </Table>
      </div>
    );
  };
  export default Home;

  const books = 
  [
    {
        "id": "1",
